import React from 'react';
import logo from './logo512.png';
import './App.css';


function App() {
  return (

    <div className="App">

      <header className="App-header">
    <p>COINFLIP</p>


        <img src={logo} className="App-logo" alt="logo" />





      </header>
    </div>
  );
}

exports.myDateTime = function () {
  return Date();
};


export default App;
